    .TxUlpsActiveClkNot   (TxUlpsActiveClkNot),
    .TxStopStateC         (TxStopStateC),
    //To LVDS data lane
    .Tx_LP_D_P            (Tx_LP_D_P),
    .Tx_LP_D_P_OE         (Tx_LP_D_P_OE),
    .Tx_LP_D_N            (Tx_LP_D_N),
    .Tx_LP_D_N_OE         (Tx_LP_D_N_OE),
